});
const store = createStore(rootReducer);

export default function App() {
  return (
    <Provider store={store}>
      <NavigationContainer>
        <SafeAreaProvider>
          <View style={styles.container}>
            <Text>
              <Daily/>
              <Button content="Hello" />
            </Text>
          </View>
        </SafeAreaProvider>
      </NavigationContainer>
    </Provider>
